TypeScript의 경우 JavaScript의 자료형과 대응되며 함수와 배열도 객체이므로 Object 타입을 가지게 된다.

string(문자열)
number(숫자)
noolean(부울 값)
null
undefined
symbol
nigint
object

bigint의 경우 JS에도 추가된 데이터 타입이지만 처음 보게되어 조사를 해보았다.

number는 2의 53승까지의 정수를 표현할 수 있지만 bigint를 이용하면 이보다 큰 수도 표현할 수 있게 된다.

