배열을 제외한 다른 것들의 경우 any 타입에서 파생된 값들은 전부 any 타입으로 지정이 된다.
그리고 사용하면서 어떠한 배열에는 보통 동일한 타입을 넣는 경우가 많아서
지금 현재 위에서 본 배열에 관한 타입은 외우진 못할 것 같고 그때 사용할 일이 생기면 구글링을 해서 바로바로 사용하도록 하자.
타입스크립트가 명시적으로 any를 반환하는 경우
