때문에  { prop: { nested: string } } 으로 타입을 표기하게 된다면 nested로 구조분해 할당된 속성의
변수명을 string에 대입하는 꼴이 됩니다.

구조분해 할당된 객체의 타입을 올바르게 표기 하려면 아래와 같이 해야합니다.
const { prop: { nested } }: { prop: { nested: string } } = {
