2.13.1 구조적 타이핑
객체가 어떻게 만들어졌든 구조가 같으면 같은 객체로 인식한다.
interface A {
    name: string;
}
interface B {
    name: string;
    age: number;
}

const aObj = {
    name: 'zero',
}
const bObj = {
    name: "zero",
    age: 32,
}

const aToA: A = aObj;
const bToA: A = bObj;
const aToB: B = aObj; // error
const bToB: B = bObj;

위에서 보았던 코드이다.
interface A, B가 완전히 동일하지는 않지만 interface B는 A에 존재하는 name 속성을 가지고 있다.
B는 A이기 위한 모든 조건을 충족하고 있다.
따라서 B 인터페이스는 구조적 타이핑 관점에서 A 인터페이스라고 볼 수 있다.
반대로 A ≠ B 이다.
서로 대입하지 못하게 하려면 어떻게 해야할까?
서로를 구분하기 위한 속성을 추가해야한다.
interface Money {
    __type: 'money';
    amout: number;
    unit: string;
}
interface Liter {
    __type: 'liter';
    amout: number;
    unit: string;
}

// 인덱스 시그니처를 사용한 타입 복사
interface a {
    amout: number;
    unit: string;
}

type Money = {
    [key in keyof a]: a[key];
}

type Liter = {
    [key in keyof a]: a[key];
}
// 인덱스 시그니처에는 다른 속상값이 들어올 수 없음

//상속을 이용한 방법
interface a {
    amout: number;
    unit: string;
}

interface Money extends a {
    __type: 'money';
}

interface Money extends a {
    __type: '';
}

