타입을 검사할 때
nerver와 함께 사용






optional 타이핑
interface Exmaple{
    hello: string;
    world?: number;
}

위와 같이 객체의 타입을 선언하면, optional 타이핑을 할 수 있습니다.
이 타입을 사용하는 객체는 아래와 같은 형태가 될 수 있습니다.
const example1: Example = { hello: 'hello' };
const example2: Example = { hello: 'hello', world: 'world' };

optional로 선언한 word 프로퍼티의 타입은  number | undefined가 됩니다.
따라서 속성이 존재하지 않아도 되고, 아래와 같이 undefined를 대입할 수도 있습니다.
const example2: Example = { hello: 'hello', world: undefined };

readonly 타이핑
interface Exmaple{
    hello: string;
    readonly wow: boolean;
    readonly multiple?: symbol;
}

위와 같이 readonly 키워드를 사용해서 객체 안에 있는 프로퍼티를 읽기 전용 타입으로 정의할 수 있습니다.
그리고 multiple 프로퍼티처럼 optional과 readonly 이렇게 동시에 여러개의 수식어를 붙일 수 있습니다.
잉여 속성 검사 (Excess Property Checking)
interface Exmaple{
    hello: string;
}

const example: Example = {
    hello: 'hi',
    why: '에러 발생',
}
/*
Type '{ hello: string; why: string; }' is not assignable to type 'Example'.  
Object literal may only specify known properties, and 'why' does not exist in type 'Example'.(2322)
*/

const  obj = {
    hello: 'hi',
    why: '이건 에러 안남',
}
const example2: Example = obj;

Example 인터페이스에 why 속성이 없으므로 example 변수에서 에러가 발생합니다. 하지만 example2에서는 에러가 발생하지 않습니다. 왜냐하면, example 객체는 객체 리터럴을 대입했고, example2는 obj 객체 자체를 대입했기 때문입니다. 이 두 방식은 타입을 검사하는 방법이 다릅니다.
객체 리터럴을 이용해서 대입하면 잉여 속성 검사가 실행됩니다. 잉여 속성 검사는 타입에서 선언하지 않은 속성을 사용할 때 에러를 표시하는 것을 의미합니다. 하지만 변수를 대입할 때는 객체 간 대입 가능성을 비교하게 됩니다.
구조 분해 할당 타이핑시 주의점
const { prop: { nested: string } } = {
    props: { nested: 'hi' },
}
console.log(nested);

구조분해 할당의 타입은 위와같이 하면 안됩니다. 위 코드는 nested의 타입을 string으로 표기한 것이 아니라 nested의 속성 값을 string이라는 변수 이름에 대입한 것입니다.
INFOconst obj = { id: 'sumin', age: 22 };
const { id, age } = obj;
const { id: username, age: year } = obj;
console.log(username)
3번째 줄에 보이는 것 처럼 구조분해 할당한 속성의 이름을 다른 변수명으로 치환할 수 있습니다.
때문에  { prop: { nested: string } } 으로 타입을 표기하게 된다면 nested로 구조분해 할당된 속성의
변수명을 string에 대입하는 꼴이 됩니다.
구조분해 할당된 객체의 타입을 올바르게 표기 하려면 아래와 같이 해야합니다.
const { prop: { nested } }: { prop: { nested: string } } = {
    prop: { nested: 'hi' },
}

console.log(nested);

인덱스 접근 타입 (Indexed Access Type)
type Animal = {
    name: string;
}

type N = string;

객체 안에 있는 속성에 커스텀 타입을 붙이고 싶을 때는 어떻게 해야 할까요? 위와 같이 하게 되면 타입을 변경해야 할 때 마다 두곳 모두 변경해야 합니다. 하지만 이건 번거로운 작업입니다. 특정 속성에 연동되도록 타입을 작성해서 한곳에서 변경하면 두곳 모두 바뀌도록 하는 것이 좋은 방법인 것 같습니다.
이럴 때는 아래와 같이 작성할 수 있습니다.
type Animal = {
    name: string;
}

type N1 = Animal['name'];

자바스크립트에서 객체의 속성에 접근하듯 접근해서 타입을 지정해주면 됩니다. 다만 '객체.속성' 꼴의 방식은 사용할 수 없습니다.
타입 표기법에 대해 이야기하고싶은 내용type Animal = {
name: Name;
}
type Name = string;
위처럼 표기하는게 더 가독성도 높고 편하지 않을까요??
인덱스 접근 타입의 타입 구하기
자바스크립트에서 변수의 타입이 궁금할 때는 typeof 변수명 키워드를 통해 구할 수 있습니다.
타입스크립트에서도 동일한 방법을 사용해서 타입을 구할 수 있습니다.
그리고 keyof 키워드를 사용해 키의 타입도 구할 수 있습니다.
const obj = {
    hello: 'world',
    name: 'zero',
    age: 28,
}
type Keys = keyof typeof obj;
// type Keys = 'hello' | 'name' | 'age'
type Values = typeof obj[Keys];
// type Values = string | number

keyof 속성 더 알아보기
객체에 인덱스 시그니처 사용하기
type HelloAndHi = {
    [key: 'hello' | 'hi' ]: string;
}
/*
An index signature parameter type cannot be a literal type or generic type. Consider using a mapped object type instead.(1337)
*/

type HelloAndHi2 = {
    [key in 'hello' | 'hi' ]: string;
}

인덱스 시그니처를 사용할 때 처럼 객체에서도 속성에 전부 타입을 지정하지 않고 일부 속성에만 타입을 부여할 수 있습니다. 하지만 HelloAndHi 처럼 키의 타입을 지정할 순 없습니다.
왜나하면 인덱스 시그니처에 사용할 수 있는 타입은 string, number, symbol, 템플릿 리터럴 타입과 이들의 유니언 뿐입니다.
그래서 매핑된 객체 타입을 사용해서 HelloAndHi2 처럼 타입을 지정해야합니다. in 연산자를 사용하면 인덱스 시그니처가 표현하지 못하는 타입을 표기할 수 있습니다.
매핑된 객체 타입이란 기존의 다른 타입으로부터 새로운 객체 속성을 만들어내는 타입을 의미합니다.
인터페이스에서는 사용하지 못하고 타입 별칭에서만 사용할 수 있습니다.
매핑된 객체 타입 사용 예시
interface Original = {
    name: string;
    age: number;
    married: boolean;
}
type Copy = {
    [key in keyof Original]: Original[key];
}

기존의 타입을 복사해야 할 때 위와 같이 사용할 수 있습니다.
그리고 매핑된 객체 타입으로 다른 타입을 가져올 때도 readonly나 optional 설정을 할 수 있습니다.
반대로 타입을 복사해서 가져올 때 수식어를 제거한채로 가져올 수도 있습니다.
interface Original = {
    readonly name?: string;
    readonly age?: number;
    readonly married?: boolean;
}
type Copy = {
    -readonly [key in keyof Original]-?: Original[key];
}

타입을 복사해서 가져올 때 이름을 변경할 수도 있습니다.
interface Original = {
    name: string;
    age: number;
    married: boolean;
}
type Copy = {
    [key in keyof Original as Capitalize]: Original[key];
}

타입과 집합의 유사한 점



집합
타입스크립트 타입




전체집합
unknown


공집합
never


교집합
&


합집합
\



유니언 타입
타입스크립트에서 유니언 타입은 일종의 합집합 역할을 합니다.
let strOrNum: string | number = 'hello';
strOrNum = 123;

위 예시의 경우 strOrNum 의 타입은 string과 number의 합집합이라고 생각할 수 있습니다.
하지만 변수에 대입된 값이 두개의 타입을 모두 만족할 수는 없습니다. 이 경우 교집합을 나타내는 부분은 never 타입이 됩니다.
인터섹션 타입
type nev = string & number;
// type nev = never;

타입스크립트에서 인터섹션 타입은 교집합을 나타냅니다.
타입과 집합의 다른 점
type H = { a: 'b' } & number;
// type H = { a: 'b' } & number;

null/undefined를 제외한 원시 자료형과 비어 있지 않은 객체를 & 연산할 때는 교집합이 never가 되지 않습니다.
즉, 타입 H는 never가 되지 않습니다. 객체의 타입과 number는 겹치는 타입이 없어서 never가 되야하는데 그렇지 않습니다. 이는 타입스크립트의 예외 사항입니다. 자세한 것은 뒤에 공부할 2.28절에서 알아보겠습니다.
자바스크립트에서 extends 키워드를 사용해서 클래스를 상속하듯이 타입도 상속할 수 있습니다.
interface 상속하기
interface Animal {
    name: string;
}
interface Dog extends Animal {
    bark(): void;
}
interface Cat extends Animal {
    meow(): void;
}

type 상속하기
type Animal = {
    name: string;
}
type Dog = Animal & {
    bark(): void;
}
type Cay = Animal & {
    meow(): void;
}
type Name = Cat['name'];

상속시 기억할 것

타입 별칭이 인터페이스를 상속할 수도 있고, 그 반대도 가능합니다.
여러개 타입을 상속할 수도 있습니다.
상속할 때 부모의 타입을 변경할 수도 있습니다. 단, 더 좁은 타입으로만 변경 가능합니다.
ex) string -> 'hello'



interface A {
    name: string;
}
interface B {
    name: string;
    age: number;
}

[[객체를 타이핑하기#잉여 속성 검사 (Excess Property Checking)]] 에서 보면 객체 리터럴이 아닌 변수를 대입할 때는 잉여 속성 검사가 진행되지 않는다고 합니다. 따라서 변수를 대입할 때는 객체 간 대입 여부를 판단해야 합니다.
위 인터페이스의 경우 B 타입 객체를 A타입 변수에 할당할 수는 있지만, A 타입 객체를 B타입 변수에 할당할 수 없습니다.
왜냐하면 타입은 좁은 타입에서 넓은 타입으로 대입하는 것만 가능하기 때문입니다.
A타입이 B타입보다 더 넓은 타입이므로 B타입에서 A타입으로 대입이 가능합니다.
어떤 타입이 더 넓은 타입일까?

타입 이름이 다르더라도 구조가 같으면 대입할 수 있다
제곧내
interface Money {
    amount: number;
    unit: string;
}

interface Liter {
    amount: number;
    unit: string;
}

const liter: Liter = { amount: 1, unit: 'liter' };
const circle: Money = liter;

위의 예시처럼 Money 와 Liter는 서로 다른 타입이지만 구조가 같기 때문에 대입할 수 있습니다.
interface Money {
    __type: 'money';
    amount: number;
    unit: string;
}

interface Liter {
    __type: 'liter';
    amount: number;
    unit: string;
}

구조는 같지만 이름은 다른 타입 간에 대입을 막으려면 위의 예시처럼 __type 같은 브랜드 속성을 추가할 수 있습니다.
타입에서 중복된 부분은 제네릭으로 해결
interface Person {
    type: 'human',
    race: 'yellow',
    name: N,
    age: A,
}

interface Zero extends Person {}
interface Nero extends Person {}

위와 같이 중복되는 부분은 제네릭 타입을 통해 해결할 수 있습니다.
제네릭 표기는  <>로 하며 인터페이스 이름 바로 뒤에 위치합니다.
제네릭 표기 위치
함수 표현식에서 제네릭 표기
const personFactoryE = (name: N, age: A)=> ({
    type: 'human',
    race: 'yellow',
    name,
    age,
});

함수 선언문에서 제네릭 표기
function personFactoryE(name: N, age: A) {
    return ({
        type: 'human',
        race: 'yellow',
        name,
        age,
    })
};

제네릭에 기본값 지정해두기
interface Person {
    type: 'human',
    race: 'yellow',
    name: N,
    age: A,
}

함수 매개변수에 기본 값을 지정해두는 것 처럼 제네릭도 이와 마찬가지로 기본 타입을 지정해둘 수 있습니다.
제네릭의 타입 추론
interface Person {
    type: 'human',
    race: 'yellow',
    name: N,
    age: A,
}

const personFactoryE = (name: N, age: A): Person => ({
    type: 'human',
    race: 'yellow',
    name,
    age,
});

const zero = personFactoryE('zero', 28);

personFactoryE 에서 A에 기본값으로 unknown이 지정되어 있지만 함수 호출시 대입한 number 타입이 더 좁은 타입이므로 number로 추론됩니다.
타입 매개변수 (T)
function values(initial: T[]){
    return {
        hashValue(value T){ return initial.includes(value) },
    };
}

const savedValues = values(['a', 'b', 'c']);
savedValues.hasValue('x');

위와 같이 T를 사용해 타입 매개변수를 선언할 경우 타입스크립트가 타입을 추론합니다.
위 예시의 경우 savedValues의 타입은 string[]으로 추론됩니다.
만약 T를 string 대신 'a' | 'b' | 'c'와 같은 유니언으로 추론되게 하려면 타입 매개변수 앞에 const 키워드를 붙이면 됩니다.
제네릭에 제약 걸기
타입 매개변수에는 extends 문법으로 타입에 제약을 표시할 수 있습니다. 제약을 걸어두면 그 제약과 동일하거나 혹은 더 구체적인 타입만 대입할 수 있습니다.
자주 사용되는 제약들



의미
코드




모든 객체



모든 배열



모든 함수



생성자 타입
 any>


모든 타입




제약은 타입 매개변수가 아님!
interface V0 {
    value: any;
}

const returnV0 = (): T => {
    return { value: 'test' };
}

위 예시처럼 타입을 선언할 수 없습니다. 왜냐하면 현재 제네릭 타입 매개변수는 V0라는 제약이 걸려있기 때문에 V0 뿐만 아니라 V0보다 더 좁은 타입도 대입이 가능합니다. 예를들어 { value: any, key: string } 타입도 V0보다 좁은 의미의 타입이기 때문에 대입 가능합니다. 하지만 returnV0 함수의 반환값은 V0만을 만족하기 때문에 에러가 발생합니다.
function onlyBoolean(arg: T = false): T{
    return arg;
}

위와 같은 경우에 arg의 기본값으로 false를 넣으면 에러가 발생합니다. 왜냐하면 타입 매개변수 T에 boolean 제약이 걸려있기 때문입니다. boolean 타입 제약이면never 타입도 대입이 가능합니다. 따라서 T가 boolean이라고 확정된 것이 아니기 때문에 기본값을 설정할 수 없습니다.
컨디셔널 타입 설정
type A1 = string;
type B1 = A1 extends string ? number : boolean;

자바스크립트에서 삼항연산자를 사용할 때 처럼 타입 또한 조건에 따라 다르게 설정할 수 있습니다.
그리고 자바스크립트처럼 중첩해서 사용할 수도 있습니다.
컨디셔널 타입이 자주 사용되는 곳
타입을 검사할 때
type = Result = 'hi' extends string ? true : false;
type = Result2 = [1] extends [string] ? true : false;

nerver와 함께 사용
type OmitByType = {
    [K in keyof O as O[k] extends T ? never : K]: O[K];
};
type Result = OmitByType;

매핑된 객체 타입에서 키가 nerver이면 해당 속성이 제거되기 때문에 위 예시처럼 사용할 수도 있습니다.

week2/haemin.html.body:
출처이 내용은 타입스크립트 교과서 책을 읽고 스터디한 내용을 바탕으로 정리했습니다.
2.10 객체의 속성과 메서드에 적용되는 특징을 알자
기본적으로 타입스크립트는 객체를 리터럴로 작성했냐 변수를 대입했냐에 따라서 검사 방법이 달라집니다.
객체 리터럴을 대입하면 잉여속성 검사가 실행이 되고 변수를 대입하면 실행하지 않습니다 이 잉여속성 검사는 타입에서 선언하지 않는 속성을 사용했는지 확인하는 역할을 합니다.
타입스크립트에서는 인덱스 시그니처라는게 있습니다
type test ={
  [key:string]:string
}

객체의 특정 타입을 미리 매핑해서 특정 타입으로 만들수 있는거죠 지금은 key가 string이고 value값이 string인 객체 타입을 미리 래핑 해 두었습니다.
이때 이 key로 설정할 수 있는 타입은 string,number,symbol밖에 없는데요 실제 만들어서 사용하려면 더 많은 타입들이 들어가기 위해서 해당 타입의 확장이 필요합니다.
따라서 in 키워드를 통해 이를 매핑 시킬 수 있습니다.
interface original {
  name:string;
  age:number;
}

type copy = {
  [key in keyof original] : original[key];
}

기본적으로 key의 값이 3가지가 필요하는 모두 | 합집합 기호를 통해 key값에 넣어 주어야 합니다 따라서 original의 key값을 뽑게 되면 name | age 가 나오게 되고 key값에 들어가면서 copy는 original과 똑같은 타입이 됩니다.
2.11 타입은 집합이다
타입을 사용할때는 집합이랑 비슷하게 생각을 하면됩니다. 집합과 똑같이 합집합 | 교집합 & 전체 집합 unknown 공집합 never 로 생각할 수 있습니다. 이런 특성때문에 타입은 항상 좁은 타입에서 넓은 타입으로 대입할 수 있다는 특징을 가지고 있습니다.
다만 여기에서 조심해야 할 부분이 있는데요 바로 빈객체는 null 과 undefined를 제외한 모든 값을 의미하는 타입입니따 따라서 I는 never 가 나오게 되는거죠
type H = {a:'b'} & number;
type G = null & {b:'c'};
type I = {} & null;

2.13 대입 방법을 배우자
그러면 좁은 타입에서 넓은 타입으로 대입할 수 있다고 했는데 조금 더 자세하게 보겠습니다.
객체
interface A{
  name: string
}

interface B{
  name: string;
  age:number;
}

const aObj = {
  name:'Kim'
}

const bObj = {
  name:"Park",
  age:20
}

const a:A = aObj;
const b:B = bObj;

const abReference:A = bObj;
const baReference:B = aObj;
//error

const abLiteral:A = {
  name:"Park",
  age:20,
}
// 리터럴을 입력했기 때문에 잉여 속성 검사가 펼쳐진다.

A타입으로 선언된 객체에 B타입의 객체를 넣을 수 있지만 B타입의 객체에는 A타입의 객체를 넣을 수 없습니다. A타입은 B타입 보다 더 큰 타입입니다 큰 타입이라는 것은 타입이 강제 되어 있는 값이 작다 라는 것입니다. 따라서 타이핑이 덜 되어 있는 A타입이 더 큰 타입이라고 할 수 있는것이죠
합집합 교집합
interface A{
  name: string
}

interface B{
  age:number;
}

function testOR(): A|B{
  if(Math.random()>0.5){
    return {
      age:28
    }
  }
  return {
    name:'Kim'
  }
}

function testAND(): A &B{
  return {
    name:'Kim',
    age:20,
  }
}

const test1:A|B = testAND();
const test2:A&B = testOR();
// error

A | B는 각각의 개별 타입인 A, B A&B보다 넓은 타입 입니다. A | B가 나마지에 비해서 더 강제되어 있는게 작죠 따라서 느슨한 넓은 타입입니다. 즉 A | B에 A, B A&B는 추가할 수 있지만 반대인 경우에는 불가능 합니다.
튜플
튜플을 보겠습니다 num은 튜플이고 numArr는 배열입니다.
let num:[1,2]=[1,2];
let numArr:number[] = [1,2,3,4,5,6,7,8];

num = numArr;
//error
numArr = num;

let a:['hi',1]= ['hi',1];
let numStrArr:(number|string)[] =  [1,"hi",2,3];

numStrArr = a;
a= numStrArr
//error

똑같이 생각하면 됩니다. num은 타입이 더 강제되어 있으므로 좁은타입이고 numArr 같은 경우에는 타입이 상대적으로 더 느슨합니다. 따라서 num에는 numArr를 대입할 수 없지만 numArr에는 num을 대입할 수 있습니다.
readonly
하지만 조금 외워야 하는 부분이 있습니다 바로 readonly가 들어가면 인데요.
let num:readonly [1,2]=[1,2];
let numArr: number[] = [1,2,3,4,5,6,7,8];

num = numArr;
//error
numArr = num;
//error

이번에는 둘다 error가 발생 합니다. readonly가 붙인 수식어는 기본적으로 더 넓은 타입이 됩니다. 구정 할 수 없으니 강제가 줄은 것이죠. 따라서 num에 numArr를 넣으면 튜플이 강제된게 더 많기 때문에 위에서 봤던것 같이 에러가 발생하고 반대인 경우에는 위에서는 되었으나 readonly 때문이 더 넓은 타입이 되어서 대입할 수 없습니다.
객체에서는 상황이 달라지는데요
객체에서는 readonly가 붙어도 서로 대입할 수 있습니다.
interface ReadOnly{
  readonly a: string;
  readonly b: string;
}

interface Original{
  a:string;
  b:string;
}

const org:Original ={
  a:'a',
  b:'b',
}

const ronly:ReadOnly = {
  a:'a',
  b:'b',
}

const org2:ReadOnly = org
const ronly2:Original = ronly

느낌에 JS에서 처럼 타입이 강제되는지 아닌지는 참조자에만 관여하기 때문에 일어나는 일인것 같습니다. (확실하지 않음)
옵셔널
객체에서 옵셔널도 잘 생각해보면 타입 | undefined이랑 같습니다. 따라서 위에서 합집합 교집합에서 했던것 처럼 적용하면 유니온이 더 넓은 타입 된다는 결론을 내릴 수 있습니다.
결론
즉 타입이 많을 수록 제한되어 있는게 많아 더 좁은 타입이고 타입이 적을수록 제한되어 있는게 적어 더 넓은 타입입니다. 그리고 타입은 항상 좁은 타입에서 넓은 타입으로 대입할 수 있습니다.
2.13 구조적 타입
타입은 모든 속성이 동일하면 타입의 이름이 다르더라도 동일한 타입으로 취급합니다. 
type Arr = number[];
type CopyArr = {
  [key in keyof Arr]:Arr[key]
}

const copyArr:CopyArr = [1,3,9];

CopyArr는 객체지만 number[]와 같습니다. 즉 구조적 타이핑의 특성을 가지고 있어 둘은 같은 것이죠
type SimpleArr ={[key:number]:number, length:number};
const simpleArr:SimpleArr = [1,2,3];

다음과 같은 재미있는 코드도 가능합니다. arr의 요소가 전부 타이핑이 되어있으니 arr와 같은거죠
그러면 구조적 타입의 특성을 가지고 있지 않게 하려면 어떻게 할까요? 간단합니다. 서로 구분이 되는 속성을 하나 추가해 주기만 하면됩니다. 
⭐ 2.14 제네릭
타입스크립트도 타입간의 중복을 방지하기 위해서 제네릭 이라는 것을 사용합니다. 
function values(inital:T[]){
  return {
    hasValue(value:T) {return inital.includes(value)}
  }
}

const savedValues = values(['a','b','c']);
savedValues.hasValue('x')

inital의 타입을 T로 잡아서 해당 타입을 기반으로 계산하게 해줍니다.
다만 여기서는 조금 의도치 않게 타입이 추론이 되는데요. a,b,c 문자열 안에 있는지 확인하려는게 목적이었지만 여기서는 T는 string으로 추론이 됩니다.
이를 해결하기 위해서는 들어오는 인자 값이 상수라고 명시를 해줘야 하는데요 방법은 2가지가 있습니다.

typescript 5.0이전

function values(inital: readonly T[]){
  return {
    hasValue(value:T) {return inital.includes(value)}
  }
}

const savedValues = values(['a','b','c'] as const);
savedValues.hasValue('x')

as const를 사용해서 상수로 명시해주고 readonly가 추가된 만큼 inital도 readonly를 추가해 줍니다.

typescript 5.0이후

function values(inital: T[]){
  return {
    hasValue(value:T) {return inital.includes(value)}
  }
}

const savedValues = values(['a','b','c']);
savedValues.hasValue('x')

const라는 매개변수가 도입되어 다음과 같이 작성하면 T를 추론할때 as const 붙인 값으로 추론합니다.
제약
제네릭을 사용해서 여러타입을 정의할 수 있으니 당연히 제약을 걸 수도 있습니다. extends라는 키워드를 사용해서 제약을 걸 수 있습니다.
function values(inital: T[]){
  return {
    hasValue(value:T) {return inital.includes(value)}
  }
}

const savedValues = values(['a','b','c']);
const savedNumberValues = values([1,2,3]);
// error

이러면 T제네릭은 string에 대입할수 있는 타입만 정의할 수 있도록 제한이 됩니다 따라서 1,2,3과 같은 숫자는 넣을 수 없죠
 // 모든 객체
 // 모든 배열
any> // 모든 함수
any> // 생성자 타입
 // 모든 타입 string | number | symbol

이를 응용해서 다음과 같이 제네릭에 들어올 인자를 제한할 수 있습니다.
다만 여기서 중요한것이 extends를 이용해서 제한을 하면 ⭐해당 타입에 대입할 수 있는 타입이 제한⭐이 되는것입니다.
다음을 보면 당연하게 되어야 한다고 생각하죠?
const returnV1 = ():T =>{
  return false;
}

// Type 'boolean' is not assignable to type 'T'.

하지만 실상은 에러입니다. 왜그럴까요?
T는 boolean의 타입으로 제한하기도 하지만 제한은 해당 타입에 대입할 수 있는 타입이 제한이 된다고 했습니다 즉 boolean 타입에 대입할 수 있는 never가 존재합니다. 따라서 T는 never가 될 수 있으므로 return false가 불가능한것입니다.
이번에는 객체로 보겠습니다.
interface V0{
  value :any;
}

const returnV0 = ():T =>{
  return {value:'test'};
}
// error

똑같이 V0로 제약을 걸어 두었고 T를 반환하고 있습니다. 여기서도 V0에 대입할 수 있는 타입들로 제한이 걸리는데 { value : ‘test’ , …args} 해당 타입도 가능하기 때문에 불가능 한 것이죠
비슷하게 하나 더 보겠습니다.
function onlyBoolean(arg:T = false){
  return arg;
}

똑같이 boolean 이외에 never가 들어올 수 있기 때문에 T를 false로 지정하지 못합니다. never의 arg가 세상에 어디있겠습니까
저자에는 이에 대한 해결방법으로 제네릭을 쓰지말자를 내놓았습니다.
조건문
그러면 타입에 제한을 알아봤으니 조건문을 보겠습니다. 똑같이 extends라는 키워드를 사용합니다.
제가 생각하기에는 제네릭을 정의하는 곳에서는 정의 이기때문에 조건문과 제약을 걸 수 있지만 실제로 타입을 정의하는 곳에서는 제네릭을 제약 거는게 이상하므로 extends는 조건문 키워드가 된다라고 구분지어봤습니다 (확실하지 않음)
type Result = T extends String ? true : false

T가 String이 맞다면 true를 반환하고 아니라면 false를 반환합니다.보통은 타입 검사를 할때 자주 사용합니다.
여기서 새로운 특징은 never인데요 객체나 배열에서 만약 never로 지정된다면 타입스크립트에서는 해당 속성을 지워줍니다.
type OmitByType ={
  [O in keyof T as T[O] extends K ? never: O ]: T[O];
}

// 같은 기능을 하는 다른 방법도 만들어 보자

다음과 같이 never를 사용해서 key값을 지울 수 있습니다.
또 신기한 특성중 하나가 분배법칙이 적용된다는 것입니다.
type IsString = T extends string ? true : false;

type Result = IsString;

직관적으로 생각 했을때는 IsString안에 string과 number가 들어가있고 이것은 string보다 넓은 타입이므로 string에 대입할 수 없습니다. 따라서 false가 나올것이라 예상을 하지만 실제로 보면 boolean타입으로 잡아주고 있습니다.
이는 분배법칙 때문입니다. 실제로 실행을 하면 IsString IsString 이렇게 실행이 되기 때문에 true와 false가 둘다 나와 boolean 타입이 되는것이죠
그러면 의도와 같이 두 타입을 같이 넘기려면 어떻게 해야 할까요? 분배법칙이 실행되지 않게 해야 합니다.
type IsString = [T] extends string ? true : false;

type Result = IsString;

제네릭에 []를 붙여 줌으로써 hi와 3을 같이 넘겨줄 수 있습니다.
여기서도 마찬가지로 never가 말썽을 피우는데요. never또한 분배법칙이 일어나서 나오는 문제들이 있습니다. 기본적으로 never는 공집합을 의미하기 때문에 해당 never를 분배법칙하면 결국 아무것도 실행되지 않습니다. 공집합을 어떻게 나눌까요?? 나눠사 나오는게 없으니까요
그래서 제네릭에 never가 들어가면 타입의 값은 never가 되는것이죠
type IsString = [T] extends [never] ? true : false;

type Result = IsString;
// true


???: 내가 이해한 분배 법칙이랑 다른데?? 왜 never에도 []를 명시해 주어야 할까?

제네릭 판단
제네릭은 기본적으로 판단을 뒤로 미루는 특징이 있습니다. 따라서 다음과 같은 코드는 타입을 읽을 수 없습니다.
function test(a:T){
  type R = T extends string ? T : T;
  const b:R = a;
}

우리가 봤을때는 R의 반환값이 T라는것을 알지만 타입스트립트는 제네릭의 판단을 뒤로 미루기 때문에 새로운 타입인 R의 타입이 T라는 것을 알지 못합니다. 이런 경우는 보통 infer를 쓴다고 합니다?

week2/taerim.html.body:
2.10 객체의 속성과 메서드에 적용되는 특징을 알자

객체의 속성을 옵셔널로 쓰거나 readonly 로 만들 수 있다
interface World {
  name: string;
  people: number;
  readonly sky: boolean;
  pet?: boolean;
  // World.pet?: boolean | undefined
}

const world: World = {
  name: 'Wonderland',
  people: 10,
  sky: true,
};

world.sky = false;
// Cannot assign to 'sky' because it is a read-only property.


객체 리터럴을 대입할 때와 변수를 대입할 때의 타입 검사 방식이 달라진다
interface World {
  name: string;
}

const world: World = {
  name: 'Wonderland',
  people: 10,
  // Type '{ name: string; people: number; }' is not assignable to type 'World'.
  // Object literal may only specify known properties, and 'people' does not exist in type 'World'.
};

const obj = {
  name: 'Wonderland',
  people: 10,
};

const world2: World = obj;

function unityWorld(world1: World, world2: World): World {
  return { name: world1.name + world2.name };
}

unityWorld(obj, { name: 'hi', people: 10 });
// Argument of type '{ name: string; people: number; }' is not assignable to parameter of type 'World'.
// Object literal may only specify known properties, and 'people' does not exist in type 'World'.


객체 리터럴: 잉여 속성 검사(Excess Property Checking)
타입 선언에서 선언하지 않은 속성을 사용할 때 에러를 표시


변수: 객체 간 대입 가능성을 비교


구조 분해 할당 시 명시적 타입 타이핑에 유의하기
// ❌
const {
  props: { nested: string },
} = { props: { nested: 'hi' } };

// ⭕️
const {
  props: { nested },
}: { props: { nested: string } } = { props: { nested: 'hi' } };


특정 속성의 타입을 별도의 타입으로 만들기

인덱스 접근 타입(Indexed Access Type)
type Animal = {
  name: 'zebra' | 'lion';
};

type AnimalName = Animal['name'];
// type AnimalName = "zebra" | "lion"




객체의 키의 타입과 값의 타입 구하기

keyof 연산자 사용하기
const obj = {
  hello: 'world',
  name: 'ttaerrim',
  age: 24,
};

type Keys = keyof typeof obj;
type Values = (typeof obj)[Keys];




keyof

타입스크립트에서는 배열을 위해 객체의 키에 string, symbol + number 타입 허용type Keys = keyof any;
// type Keys = string | number | symbol


keyof 배열
모든 number → 이해가 잘 안 됨..
배열 속성 이름
length, forEach, lastIndexOf 등 배열의 공통 속성


배열 인덱스 문자열
[1, 2, 3] 이라면 인덱스인 '0' | '1' | '2'






인덱스 접근 타입으로 특정 키들의 값 타입 추리기
const obj = {
  hello: 'world',
  name: 'ttaerrim',
  age: 24,
};

type Values = (typeof obj)['hello' | 'name'];
// type Values = string


매핑된 객체 타입 별칭의 키로 사용하기
```tsx
// ❌
type HelloAndHi = {


[key: 'hello' | 'hi']: string;
// An index signature parameter type cannot be a literal type or generic type. Consider using a mapped object type instead
  };
  // ⭕️
  type HelloAndHi = {
[key in 'hello' | 'hi']: string;
  };

  ```tsx
  interface Original {
    name: string;
    age: number;
    married: boolean;
  }

  type Copy = {
    [key in keyof Original]: Original[key];
  };

  /**
  type Copy = {
      name: string;
      age: number;
      married: boolean;
  }
  */

keyof 연산자를 사용해 Original 의 속성 이름만 추릴 수 있다
인덱스 접근 타입으로 원래 객체의 타입을 가져온다
'name': Original['name'] 에서 string 을 가져옴
'age': Original['age'] 에서 number 을 가져옴
'married': Original['married'] 에서 boolean 을 가져옴




튜플에 매핑된 객체 타입 적용하기
```tsx
type Tuple = [1, 2, 3];
type CopyTuple = {


[Key in keyof Tuple]: Tuple[Key];
  };

  - 질문
    여기서 `Tuple[Key]` 안의 `Key` 는 왼쪽의 `Key in keyof Tuple` 에서 가져오는 건가?
  - 읽기 전용

    ```tsx
    interface Original {
      name: string;
      age: number;
      married: boolean;
    }

    type Copy = {
      readonly [key in keyof Original]: Original[key];
    };

옵셔널type Copy = {
  readonly [key in keyof Original]?: Original[key];
};


타입 제거type Copy = {
  -readonly [key in keyof Original]-?: Original[key];
};


-readonly: readonly 수식어 제거
-?: ? 수식어 제거


속성 이름 바꾸기
```tsx
type Copy = {

  [key in keyof Original as Capitalize]: Original[key];
};
```
2.11 타입을 집합으로 생각하자(유니언, 인터섹션)

타입스크립트를 집합 관계로 보기

가장 넓은 타입(전체 집합)은 unknown
가장 좁은 타입(공집합)은 never
유니언 연산자(|)는 합집합 역할
인터섹션 연산자(&)는 교집합 역할type nev = string & number;
// type nev = never;





✔️ 항상 좁은 타입에서 넓은 타입으로 대입해야 한다

any 타입은 집합 관계를 무시하므로 & , | 연산을 하지 않는 것이 좋다

null/undefined 를 제외한 자료형 & 비어 있지 않은 객체 ⇒ never 타입이 되지 않음
type H = { a: 'b' } & number;
// { a: 'b' } & number

type I = null & { a: 'b' };
// never

type J = {} & string;
// string


{}는 null과 undefined를 제외한 모든 값을 의미하는 타입이다



2.12 타입도 상속이 가능하다

상속을 사용하면 부모 객체에 존재하는 속성을 다시 입력하지 않아도 되므로 중복을 제거할 수 있다
& 연산자로 타입 상속하기
type Animal = {
  name: string;
};

type Dog = Animal & {
  bark(): void;
};

type Cat = Animal & {
  meow(): void;
};

type Name = Cat['name'];


타입 별칭이 인터페이스를 상속할 수 있고 인터페이스가 타입 별칭을 상속할 수도 있다
interface Animal {
  name: string;
}
type Dog = Animal & {
  bark(): void;
};
type Cat = Animal & {
  meow(): void;
};
type Name = Cat['name'];


타입 별칭으로 선언한 객체 타입과 인터페이스로 선언한 객체 타입이 호환된다


한 번에 여러 타입 상속하기
type Animal = {
  name: string;
};
interface Dog extends Animal {
  bark(): void;
}
interface Cat extends Animal {
  meow(): void;
}

interface DogCat extends Dog, Cat {}


상속할 때 부모 속성의 타입 변경하기
interface Merge {
  one: string;
  two: string;
}
interface Merge2 extends Merge {
  one: 'h' | 'w';
  two: '123';
}


부모에 대입할 수 있는 타입으로 좁히는 것은 가능하지만 완전히 다른 타입으로 변경하면 에러 발생interface Merge2 extends Merge {
  one: 'h' | 'w';
  two: 123;
}





2.13 객체 간에 대입할 수 있는지 확인하는 법을 배우자
interface A {
  name: string;
}
interface B {
  name: string;
  age: number;
}

const aObj = {
  name: 'zero',
};
const bObj = {
  name: 'nero',
  age: 32,
};

const aToA: A = aObj;
const bToA: A = bObj;
const aToB: B = aObj;
// Property 'age' is missing in type '{ name: string; }' but required in type 'B'.
const bToB: B = bObj;


B 타입에 A 타입 객체를 대입하는 것은 실패
A 타입에 B 타입을 대입하는 것은 좁은 타입을 넓은 타입에 대입하는 것이기 때문에 가능하다
여기서는 A 타입이 B 타입보다 넓은/추상적인 타입
B 타입이 A 타입보다 좁은/구체적인 타입


A | B 합집합은 A, B, A | B 각각의 집합과 교집합을 전부 대입할 수 없다

합집합은 각각의 집합보다 교집합보다 넓다




튜플은 배열보다 좁은 타입

튜플은 배열에 대입할 수 있으나 배열은 튜플에 대입할 수 없음

let a: ['hi', 'readonly'] = ['hi', 'readonly'];
let b: string[] = ['hi', 'normal'];

a = b;
// Type 'string[]' is not assignable to type "['hi', 'readonly']". Target requires 2 element(s) but source may have fewer


readonly 수식어가 붙은 배열이 더 넓은 타입
let a: readonly string[] = ['hi', 'readonly'];
let b: string[] = ['hi', 'normal'];

a = b;
b = a;
// Type type 'readonly ['hi', 'readonly'] is 'readonly' and cannot be assigned to the mutable type 'string[]'.


좁은 타입을 넓은 타입에 대입해야 하기 때문에~


readonly 튜플과 일반 배열 대입하기
let a: readonly ['hi', 'readonly'] = ['hi', 'readonly'];
let b: string[] = ['hi', 'normal'];

a = b;
// Type 'string[]' is not assignable to type 'readonly ["hi", "readonly"]'.
// Target requires 2 element(s) but source may have fewer.
b = a;
// The type 'readonly string[]' is 'readonly' and cannot be assigned to the mutable type 'string[]'.


a = b 배열이 튜플보다 넓은 타입
b = a
튜플이 배열보다 좁은 타입이지만
readonly 수식어가 붙으면 일반 배열보다 넓은 타입




옵셔널인 객체가 옵셔널이지 않은 객체보다 더 넓은 타입
type Optional = {
  a?: string;
  b?: string;
};

type Mandatory = {
  a: string;
  b: string;
};


Optional 타입보다 Mandatory 타입보다 넓은 타입이다
옵셔널은 기존 타입 | undefined


객체에서는 readonly 속성이 붙어도 서로 대입할 수 있다

객체의 readonly 속성은 타입의 범위에 영향을 끼치지 않음type ReadOnly = {
readonly a: string;
readonly b: string;
};
type Mandatory = {
a: string;
b: string;
};
const o: ReadOnly = {
a: 'hi',
b: 'world',
};
const m: Mandatory = {
a: 'hello',
b: 'world',
};
const o2: ReadOnly = m;
const m2: Mandatory = o;
// 모두 가능




모든 속성이 동일하면 객체 타입 이름이 달라도 동일한 타입으로 취급됨
→ 구조가 같으면 같은 객체로 인식하는 것을 구조적 타이핑(structural typing)이라고 함interface A {
  name: string;
}
interface B {
  name: string;
  age: number;
}


B 인터페이스는 A 인터페이스에 존재하는 모든 속성을 가지고 있기 때문에 구조적 타이핑 관점에서 A인터페이스라고 볼 수 있다
구조가 같아야만 동일한 것도 아니고, B가 A라고 해서 A도 B인 것도 아니다


배열에 매핑된 객체 타입
```tsx
type Arr = number[];
type CopyArr = {


[Key in keyof Arr]: Arr[Key];
  };
  const copyArr: CopyArr = [1, 3, 9];

  - `CopyArr` 타입에 존재하는 모든 속성을 숫자 배열이 가지고 있으므로 구조적으로 동일하다

  ```tsx
  type SimpleArr = { [key: number]: number; length: number };
  const simpleArr: SimpleArr = [1, 2, 3];

숫자 배열은 SimpleArr 객체 타입에 있는 모든 속성을 가지고 있다 ⇒ 왜?
숫자 배열은 구조적으로 SimpleArr 이라고 볼 수 있기 때문에 대입할 수 있다


구조적으로 동일하지 않으면 서로 대입할 수 없다
interface Money {
  __type: 'money';
  amount: number;
  unit: string;
}

interface Liter {
  __type: 'liter';
  amount: number;
  unit: string;
}

const liter: Liter = { amount: 1, unit: 'liter', __type: 'liter' };
const circle: Money = liter;
// Type 'Liter' is not assignable to type 'Money'.
// Types of property '__type' are incompatible.
// Type '"liter"' is not assignable to type '"money"'.


객체를 구별할 수 있는 속성을 추가하여 서로 대입되지 않도록 할 수 있다
__type 같은 속성을 브랜드 속성이라고 하고
브랜드 속성을 사용하는 것을 브랜딩한다고 표현한다



2.14 제네릭으로 타입을 함수처럼 사용하자

제네릭 표기는 <> 로 하고 인터페이스 이름 바로 뒤에 위치한다
제네릭을 사용해서 중복 제거하기
interface Person {
  type: 'human';
  race: 'yellow';
  name: N;
  age: A;
}

interface Zero extends Person {}
interface Nero extends Person {}


<> 안에 들어가는 N과 A가 각각 name, age 에 대입된다


인터페이스, 클래스, 타입 별칭, 함수에도 적용 가능
type Person = {
  type: 'human';
  race: 'yellow';
  name: N;
  age: A;
};

type Zero = Person;
type Nero = Person;

class Person {
  name: N;
  age: A;
  constructor(name: N, age: A) {
    this.name = name;
    this.age = age;
  }
}

type Zero = Person;
type Nero = Person;

const personFactoryE = (name: N, age: A) => ({
  type: 'human',
  race: 'yellow',
  name,
  age,
});

function personFactoryD(name: N, age: A) {
  return {
    type: 'human',
    race: 'yellow',
    name,
    age,
  };
}

🌟 함수는 함수 선언문과 함수 표현식의 제네릭 표기 위치가 다름

Array도 제네릭 타입

Array
Array 타입은 다음과 같은 꼴로 선언되어 있다
```tsx
interface Array {



  [key: number]: T;
  length: number;
}
```
**→ 제네릭으로 하나의 타입을 여러 방법으로 재사용할 수 있다**

interface 와 type 간 교차 사용도 가능
interface IPerson {
  type: 'human';
  race: 'yellow';
  name: N;
  age: A;
}

type TPerson = {
  type: 'human';
  race: 'yellow';
  name: N;
  age: A;
};

type Zero = IPerson;
interface Nero extends TPerson {}


객체나 클래스의 메서드에 제네릭을 표기할 수도 있다
class Person {
  name: N;
  age: A;
  constructor(name: N, age: A) {
    this.name = name;
    this.age = age;
  }
  method(param: B) {}
}

interface IPerson {
  type: 'human';
  race: 'yellow';
  name: N;
  age: A;
  method: (param: B) => void;
}


타입 매개변수에 default 값을 지정할 수 있다
interface Person {
  type: 'human';
  race: 'yellow';
  name: N;
  age: A;
}

type Person1 = Person;
type Person2 = Person;
type Person3 = Person;


타입 인수를 옵셔널처럼 사용할 수 있고, 지정하지 않은 타입은 기본값 타입이 됨


제네릭도 추론을 통해 타입을 알아낼 수 있다
interface Person {
  type: 'human';
  race: 'yellow';
  name: N;
  age: A;
}

const personFactoryE = (name: N, age: A): Person => ({
  type: 'human',
  race: 'yellow',
  name,
  age,
});

const zero = personFactoryE('zero', 28);


‘zero’는 string, 28은 number 타입으로 추론된다
zero의 타입은 Person
추론을 통해 타입을 알아낼 수 있는 경우 직접 타입을 넣지 않는 경우가 많다


배열을 튜플로 타입 추론되게 하고 싶은 경우

v4.9 이하

function values(initial: readonly T[]) {
  return {
    hasValue(value: T) {
      return initial.includes(value);
    },
  };
}

const savedValues = values(['a', 'b', 'c'] as const);


v5.0 이상
타입 매개변수 앞에 const 수식어를 추가



function values(initial: T[]) {
  return {
    hasValue(value: T) {
      return initial.includes(value);
    },
  };
}

const savedValues = values(['a', 'b', 'c']);


제네릭에 extends 키워드로 제약 걸기
interface Example {
  a: A;
  b: B;
}

type UseCase1 = Example;
type UseCase2 = Example;
type Usecase3 = Example;


타입 매개변수 A는 number 타입이어야 한다는 의미
UseCase1 은 A 타입에 string 타입을 대입할 수 없으므로 에러 발생
UseCase2 처럼 더 구체적인 타입은 대입 가능
📌 다음과 같이 하나의 타입 매개변수를 다른 타입 매개변수의 제약으로 사용할 수도 있다

interface Example {
    a: A,
    b: B,
}

 // 모든 객체
 // 모든 배열
 any> // 모든 함수
 any> // 생성자타입
 // string | number | symbol


타입 매개변수와 제약을 동일하게 생각하지 않기
interface V0 {
  value: any;
}

const returnV0 = (): T => {
  return { value: 'test' };
};


T는 V0에 대입할 수 있는 모든 타입을 의미하므로 에러가 발생함
{ value: string, another: string} 도 대입할 수 있기 때문
다음과 같이 해결 가능const returnV0 = (): V0 => {
  return { value: 'test' };
};

왜 에러가 난다는 거지



function onlyBoolean(arg: T = false): T {}


false 기본값 지정에서 에러가 발생하는데
never 를 모든 타입에 대입할 수 있다
따라서 T가 never 타입일 수도 있기 때문에 false 기본값이 불가능하다


다음과 같이 제네릭 쓰지 않고 해결 가능function onlyBoolean(arg: true | false = false): T {}





2.15 조건문과 비슷한 컨디셔널 타입이 있다

조건에 따라 타입을 다르게 지정할 수 있다type A1 = string;
type B1 = A1 extends string ? number : boolean;


타입 검사를 위해 사용하기type Result = 'hi' extends string ? true : false;
type Result = [1] extends [string] ? true : false;

type ChooseArray = A extends string ? string[] : never;
type StringArray = ChooseArray;
type Never = ChooseArray;


제네릭과 never 같이 사용하여 필터링 조건에 부합한 경우만 사용하고자 하는 타입 지정하기


컨디셔널 타입과 함께 사용하기
type OmitByType = {
  [K in keyof O as O[K] extends T ? never : K]: O[K];
};

type Result = OmitByType;

/*
type Result = {
    name: string;
    age: number;
}
*/


boolean인 속성을 제거하는 예시


검사하려는 타입이 제네릭이면서 유니언이면 분배법칙이 실행된다
type Start = string | number;
type Result = Key extends string ? Key[] : never;
let n: Result = ['hi'];


Result → Result | Result → string extends string ? string[] : never |  number extends string ? number[] : never→ string[] | never→ string[]
단, boolean 에 분배 법칙이 적용될 때에는 string[] | boolean[] 같은 형태가 아닌 string[] | true[] | false[] 가 됨


분배 법칙 막기type IsString = T extends string ? true : false;
type Result = IsString;


Result 타입이 true | false 이기 때문에 boolean 타입이 됨
다음과 같이 분배 법칙을 막아 해결하자type IsString = [T] extends [string] ? true : false;
type Result = IsString;


배열로 제네릭을 감싸면 분배 법칙이 일어나지 않는다




never 타입도 분배 법칙의 대상이 된다
never 는 공집합과 같으므로 공집합에서 분배 법칙을 실행하는 것은 아무것도 실행하지 않는 것과 같다type R = T extends string ? true : false;
type RR = R;
// type RR = never


컨디셔널 타입에서 제네릭과 never가 만나면 never 가 된다
never 사용할 때 분배 법칙 막기type IsNever = [T] extends [never] ? true : false;
type T = IsNever;
// type T = true
type F = IsNever;
// type F = false




제네릭이 들어 있는 컨디셔널 타입은 값의 판단이 미루어진다
function test(a: T) {
    type R = T extneds string ? T : T;
    const b: R = a;
}

// Type 'T' is not assignable to type 'R'


변수 b에 a를 대입할 때는 R 타입을 모르는 상태이다
해결
function test(a: T) {
    type R = [T] extneds [string] ? T : T;
    const b: R = a;
}

// Type 'T' is not assignable to type 'R'


타입 매개변수를 선언할 때 [T] extneds [string] 하는 것이 불가능하다?
그래서 컨디셔널 타입으로 선언

week2/donghyeok.html.body:
2주차 스터디 내용 정리
출처이 내용은 타입스크립트 교과서 책을 읽고 스터디한 내용을 바탕으로 정리했습니다.


2주차 스터디 내용 정리
2.10 객체의 속성과 메서드에 적용되는 특징을 알자
2.10.1 인덱스 접근 타입
2.10.2 매핑된 객체 타입


2.11 타입을 집합으로 생각하자(유니언, 인터섹션)
2.12 타입도 상속이 가능하다
2.13 객체 간에 대입할 수 있는지 확인하는 법을 배우자
2.13.1 구조적 타이핑


2.14 제네릭으로 타입을 함수처럼 사용하자
2.14.1 제네릭에 제약 걸기


2.15 조건문과 비슷한 컨디셔널 타입이 있다.
2.15.1 컨디셔널 타입 분배법칙







2.10 객체의 속성과 메서드에 적용되는 특징을 알자
객체의 속성에도 옵셔널이나 readonly 수식어가 사용 가능하다.
interface Example {
    hello: string;
    world?: number;
    readonly wow: boolean;
    readonly multiple?: symbol;
}
const example: Example = {
    hello: 'hi',
    wow: false,
};
example.no; // 이런건 존재 x
example.wow = true; // wow는 readonly이기 때문에 새로 할당 불가능

const example: Example = {
    hello: 'hi',
    world: undefined, // world는 옵셔널이 붙어있기 때문에 가능함
    wow: false,
};

interface Example {
    hello: string;
}
const example: Example {
    hello: 'hi',
    why: '나만 에러', // 에러 (interface Example에 why 속성 없음
}
const obj = {
    hello: 'hi',
    why: '나만 에러',
}
const example2: Example = obj; // 에러 안남


example과 example2의 차이
example: Example {}
example2: Example = obj;
객체 리터럴을 대입했느냐 obj 변수를 대입했느냐의 차이 발생





interface Money {
    amount: number;
    unit: string;
}

const money = { amount: 1000, unit: 'won', error: '에러 아님' };

function addMoney(money1: Money, money2: Money): Money {
    return (
        amount: money1.amount + money2.amount,
        unit: 'won',
    }
}
addMoney(money, { amount: 3000, unit: 'money', error: '에러' });

함수에서도 동일한 현상이 발생한다.
인수 자리에 변수로 값을 대입하면 에러가 발생하지 않지만, 객체 리터럴을 대입하면 에러가 발생한다.
이러한 현상이 발생하는 이유는 객체 리터럴을 대입할 때와 변수를 대입할 때 타입스크립트가 다르게 처리하기 때문이다.
객체 리터럴을 대입하면 잉여 속성 검사가 실행되는데 이것은 타입 선언에서 선언하지 않은 속성을 사용할 때 에러를 표시하는 것을 의미한다.
변수를 대입하면 객체 간 대입 가능성을 비교한다. (2.13절에서 자세히 알아본다고 함)
→ 여기까지 읽었을 때는 잉여 속성 검사는 선언하지 않은 속성을 잡아내기 때문에 에러를 잡아내고
변수를 대입할 때는 대입 가능성을 비교하기 때문에 여부 유무가 있을 수 있어서 에러를 나타내지는 않는 것 같다.
이 뒤의 내용은 코드를 읽어도 잘 들어오지 않아서 생략
사용하기에도 벅찰 것 같아서 우선 넘긴다.

2.10.1 인덱스 접근 타입
특정 속성의 타입을 별도 타입으로 만들고 싶으면 어떻게 해야할까?
type Animal = {
    name: number; // 여기를 변경하면
}

type N = number; // 여기도 변경해야 함

이 두 개를 연동하려면 다음과 같이 작성
type Animal = {
    name: string;
}

type N1 = Animal['name'];
type N2 = Animal["name"];
type N3 = Animal.name;

따옴표는 상관이 없다.
다만 객체의 속성에 접근하듯 . 으로 접근할 수 없다. (객체.속성)
const obj = {
    hello: 'world',
    name: 'zero',
    age: 28,
};

이러한 객체가 존재한다.
키(key)의 타입: ‘hello’ | ‘name’ | ‘age’
값의 타입은 string | number이다. (접미사에 as const를 붙였따면 값의 타입은 ‘world’ | ‘zero’ | 28이 된다.
const obj = {
    hello: 'world',
    name: 'zero',
    age: 28,
};

type Keys = keyof typeof obj; // Keys에 마우스 오버헤드를 하면 type Keys = "hello" | "name" | "age"
type Values = typeof obj[Keys]; // Values에 하면 type Values = string | number


Keys = 키의 타입: ‘keyof 객체_타입
Values = 값의 타입: ‘객체타입[키의타입]’
객체타입: obj는 값이기 때문에 앞에 typeof를 붙여서 객체타입을 만들어준다.
키의_타입: type Keys로 Keys가 키의 타입



keyof를 적용하면 ‘number | 배열속성이름유니온 | 배열인덱스문자열유니온’이 된다.
P.76 현재 이해 못함 다시 읽어야함 (2023-09-10)
→ 인덱스 시그니처, 객체의 속성 값을 전부 특정 타입으로 만들 수 있다.

2.10.2 매핑된 객체 타입
속성 전부에 타입을 지정하는 대신 일부 속성에만 타입을 부여할 수도 있다.
인덱스 시그니처를 사용해서 hello와 hi라는 속성 이름을 가진 객체를 타이핑 해보자.
type HelloAndHi = {
    [key: 'hello' | 'hi']: string;
}

An index signature parameter type cannot be a literal type or generic type. Consider using a mapped object type instead.(1337)
(parameter) key: "hello" | "hi"
이라는 에러가 발생한다.
인덱스 시그니처에서 해당 타입을 사용할 수 없다는 것을 뜻한다.
그리고 mapped object type을 대신 사용하라는 것을 고려하라고 친절히 에러 메세지로 알려준다.
&#x1F940; 인덱스 시그니처에서 사용할 수 있는 타입은 string, number, symbol, 템플릿 리터럴 타입과 이들의 유니온 뿐

매핑된 객체 타입
이란 기존의 다른 타입으로부터 새로운 객체 속성을 만들어내는 타입을 의미
인터페이스에서는 사용 불가
타입 별칭에서만 사용 가능



type HelloAndHi = {
    [key in 'hello' | 'hi']: string;
}

type HelloAndHi = {

hello: string;

hi: string;

}
in 연산자를 사용해서 인덱스 시그니처가 표현하지 못하는 타입을 표현한다.
그리고 in 연산자 오른쪽에는 유니온 타입이 와야 한다. (’hello’ | ‘hi’)
순서대로 hello: string, hi: string이 속성이 되어 최종적으로  { hello: string, hi: string } 객체가 된다.
매핑된 객체 타입을 주로 언제 사용할까?
기존 객체 타입을 복사하는 코드를 봐보자.
interface Original {
    name: string;
    age: number;
    married: boolean;
}
type Copy = {
    [key in keyof Original]: Original[key];
}

아까 위에서 말했듯이 
keyof를 적용하면 ‘number | 배열속성이름유니온 | 배열인덱스문자열유니온’이 된다.
아까 위에서와 다르게 in 옆에 바로 유니온이 오지 않았다.
유니온을 keyof 연산자를 사용해서 Original의 속성 이름만 추린다. (’name’ | ‘age’ | ‘married’)
그리고 인덱스 접근 타입(Original[key])을 사용해서 원래 객체의 타입을 가져온다.
결과적으로 Copy에 마우스 오버헤드를 해보면
type Copy = {

name: string;

age: number;

married: boolean;

}
이렇게 잘 나온다.
‘name’: Original[’name’]에서 ‘name’: string 속성이 되고 위에서처럼 순서대로 흘러간다.
튜플, 배열도 객체이므로 매핑된 객체 타입 적용이 가능하다.
예제가 너무 복잡해서 정리는 패스,, (읽어도 이해가 아직 안된 상태)
interface Original {
    name: string;
    age: number;
    married: boolean;
}
type Copy = {
    readonly [key in keyof Original]?: Original[key];
}

interface Original {
    readonly name?: string;
    readonly age: number?;
    readonly married: boolean?;
}
type Copy = {
    -readonly [key in keyof Original]-?: Original[key];
}

readonly, ? 수식어를 붙일수도, 그리고 제거할수도 있다.
interface Original {
    name: string;
    age: number;
    married: boolean;
}
type Copy = {
    [key in keyof Original as Capitalize]: Original[key];
}

// Capitalize는 문 자열의 첫 자리를 대문자화 하는 타입이다.

//type Copy = {
//    Name: string;
//    Age: number;
//    Married: boolean;
//}

(2023-09-10)

2.11 타입을 집합으로 생각하자(유니언, 인터섹션)
유니언은 | 타입으로 or을 나타내고 합집합을 의미한다.
&이라는 and 연산과 같이 동작하는 교집합 연산자도 있다. 이는 인터섹션 연산자라고도 부른다.
string | number에서 겹치는 부분은 교집합 영역이다.
그런데 string과 number를 둘다 성립하는 값은 존재하지않으며 이를 공집합이라고 부르고 never가 이를 표시한다.
타입스크립트는 타입을 집합으로 볼 수 있다. 타입스크립트에서 공집합이 never라면 전체 집합은 unknwon이다.
any 타입은 이런 집합 관계마저도 무시한다. 정말 TS의 타입을 아예 제껴버릴 수 있는 타입이다.
type A = string | boolean;
type B = boolean | number;
type C = A & B; // type C = boolean
type D = {} & (string | null) // type D = string
type E = string & boolean; // type E = never
type F = unknown | {}; // type F = unknown
type G = never & {}; // type G = never

type A, B, C는 생략하고 D부터 봐보자.
{}는 string이 포함되지만 null은 포함되지 않기 때문에 교집합 상 string타입으로 결정된다.
E는 위에서 말했듯이 string과 boolean을 모두 성립하는 값은 존재하지않는다. 공집합으로 never타입으로 결정된다.
F는 unknown은 전체집합을 의미한다고 했다. 전체집합의 합집합은 항상 전체집합이다.
G는 전체집합과 공집합의 교집합은 항상 공집합이다. never타입과 & 연산이 나오면 무조건 never타입이다.

2.12 타입도 상속이 가능하다
자바스크립트와 달리 타입스크립트는 타입을 명시해주어야한다.
자바스크립트의 경우 타입이 없기 떄문에 그냥 객체를 상속 받아서 그대로 사용하면 된다.
하지만 타입스크립트의 경우 클래스를 상속 하고 타입 속성을 또 지정해주어야한다.
interface Animal {
    name: string;
}
interface Dog extends Animal {
    bark(): void;
}
interface Cat extends Animal {
    meow(): void;
}

extends를 사용하여 기존 타입을 상속할 수 있다.
이렇게 하면 Dog와 Cat에서 name이라는 string 타입 값을 사용할 수 있다.
중복적으로 저 인터페이스 안에 일일히 name: string을 선언해줄 필요가 없어진다.
type Animal {
    name: string;
}
type Dog Animal & {
    bark(): void;
}
type Cat Animal & {
    meow(): void;
}
type Name = Cat['name'];

이렇게 타입별칭과 인터섹션(&) 연산자를 사용해서도 상속을 나타낼 수 있다.
interface Merge{
    one: string;
    two: string;
}

interface Merge2 extends Merge {
    one: 'h' | 'w';
    two: 123;
}

타입을 상속받으면서 변경할수도 있으나 아예 다른 타입으로 변경할 시 에러가 발생한다.
현재 상속받은 부분에서 two를 number 타입으로 아예 바꿔버렸기 때문에 에러가 발생한다.

2.13 객체 간에 대입할 수 있는지 확인하는 법을 배우자
interface A {
    name: string;
}
interface B {
    name: string;
    age: number;
}

const aObj = {
    name: 'zero',
}
const bObj = {
    name: "zero",
    age: 32,
}

const aToA: A = aObj;
const bToA: A = bObj;
const aToB: B = aObj; // error
const bToB: B = bObj;

나도 아이러니하였다.
느낌상 인터페이스 A에는 age가 정의되어있지않기 때문에 bToA에서 오류가 날것이라고 생각했었다.
하지만 그 반대로 인터페이스 B를 받는 aObj에서 에러가 발생한다.
좀 생각을 해보니까 타입스크립트에서는 변수를 선언해놓고 그 변수 안쓰기만해도 에러가 난다. (ts.config에서 조절이 가능한거롤 앎)
그런 느낌으로 보니까 지정해놓은 타입을 사용하지 않아서 오류가 난다.

좁은 타입은 넓은 타입에 대입할 수 있지만, 넓은 타입은 좁은 타입에 대입할 수 없다.
각 타입 속성 값이 필수적으로 필요하다. 라고 정리하면 될 것 같다.
무엇이 더 구체적으로 적혀있는 인터페이스인지 파악하는 것이 중요하다.

여기서 넓은 타입이란 interface A이고 좁은 타입은 interface B이다.
A타입이 좀더 추상적, B타입이 더 구체적이다.
예시를 한 개 더 보자.
readonly 수식어가 붙은 배열이 더 넓은 타입이다.
let a: readonly string[] = ['hi', 'readonly'];
let b: string[] = ['hi', 'normal'];

a = b;
b = a; // error

string[]이 readonly string[]보다 더 좁은 타입이므로 b에 a를 대입할 수 없다.
또한 배열이 튜플보다 넓은 타입이다.
하지만 readonly 수식어가 붙는 다면 일반 배열보다 튜플이 넓은 타입으로 변한다.
readonly > 배열 > 튜플
옵셔널 객체 > 옵셔널이 아닌 객체
옵셔널이란 기존 타입에 undefined가 유니언 된 것과 같으며 기존 타입 | undefined가 기존 타입보다 넓은 타입이므로 옵셔널인 객체가 더 넓은 타입이다.
하지만 배열과 다르게 객체에서는 속성에 readonly가 붙으면 또 서로 대입이 가능하다고 한다…

넓은 타입, 좁은 타입을 구분할 수 있다면 누가 누구에게 대입할 수 있는지 없는지를 알 수 있다.

2.13.1 구조적 타이핑
객체가 어떻게 만들어졌든 구조가 같으면 같은 객체로 인식한다.
interface A {
    name: string;
}
interface B {
    name: string;
    age: number;
}

const aObj = {
    name: 'zero',
}
const bObj = {
    name: "zero",
    age: 32,
}

const aToA: A = aObj;
const bToA: A = bObj;
const aToB: B = aObj; // error
const bToB: B = bObj;

위에서 보았던 코드이다.
interface A, B가 완전히 동일하지는 않지만 interface B는 A에 존재하는 name 속성을 가지고 있다.
B는 A이기 위한 모든 조건을 충족하고 있다.
따라서 B 인터페이스는 구조적 타이핑 관점에서 A 인터페이스라고 볼 수 있다.
반대로 A ≠ B 이다.
서로 대입하지 못하게 하려면 어떻게 해야할까?
서로를 구분하기 위한 속성을 추가해야한다.
interface Money {
    __type: 'money';
    amout: number;
    unit: string;
}
interface Liter {
    __type: 'liter';
    amout: number;
    unit: string;
}

2.14 제네릭으로 타입을 함수처럼 사용하자
제네릭에 들어가기에 앞서 굉장히 중요하다.
지금까지 타입스크립트를 사용하면서 타입덩어리를 선언할 때 <>을 통하여 많이 사용하였다.
정작 제네릭에 대한 개념이 어렵다고해서 일단 사용하기는 했는데 한번 파보겠다.
interface Zero {
    type: 'human',
    race: 'yellow',
    name: 'zero',
    age: 28,
}
interface Nero {
    type: 'human',
    race: 'yellow',
    name: 'nero',
    age: 32,
}

다음과 같이 name, age만 다른 Zero, Nero 인터페이스가 존재한다.
이때 중복을 제거하기 위해서 제네릭을 사용할 수 있다.
interface Zero {
    type: 'human',
    race: 'yellow',
    name: 'zero',
    age: 28,
}
interface Nero {
    type: 'human',
    race: 'yellow',
    name: 'nero',
    age: 32,
}

interface Person {
    type: 'human',
    race: 'yellow',
    name: N,
    age: A,
}

interface Zero extends Person {}
interface Nero extends Person {}

제네릭 표기는 <>로 하며 인터페이스 이름 바로 뒤에 위치한다.
<> 안에 타입 매개변수를 넣으면 된다.
여기서 제네릭을 쓸 때 <> 안에 타입 파라미터 개수가 일치하지않으면 에러가 발생한다.
정확히 값을 집어넣어야한다.
함수에서는 함수 선언문(Function)이냐 함수 표현식(Arrow Function)이냐에 따라 표기 위치가 다르다.
const personFactoryE = (name: N, age: A) => ({
    type: 'human',
    race: 'yellow',
    name,
    age,
})

function personFactoryD(name: N, age: A) {
    return ({
        type: 'human',
        race: 'yellow',
        name,
        age,
    })
}

함수 표현식을 제외하고 interface, type, class, function 모두 이름로 사용할 수 있다.
함수 표현식의 경우 const 함수 이름 =  로 사용한다.
interface Person {
    type: 'human',
    race: 'yellow',
    name: N,
    age: A,
}
type Person1 = Person;
type Person2 = Person;
type Person3 = Person;

이런식으로 사용할 때 지정 타입을 변경할수도있고 지정을 안한다면 기본 default 타입이 지정된다.
이 코드의 경우 Person1은 NPerson를 가지게 된다.
그리고 제네릭은 직접 타입을 넣지 않아도 추론을 통해 타입을 알아낼 수 있다.
기본값으로 unknwon이 들어있지만 좀 더 구체적인 좁은 타입이 있다면 그 타입으로 추론한다.
2.14.1 제네릭에 제약 걸기
extends 예약어를 통해서 상속뿐만 아니라 제약을 걸어줄 수도 있다.
interface Example {
    a: A,
    b: B,
}

type Usecase1 = Example; // error
type Usecase2 = Example;
type Usecase3 = Example;

Usecase1을 보자.
위의 인터페이스 Example에서 A의 값은 number 타입으로 제약을 걸어주었다.
그렇기 때문에 Usecase1에서 Example의 첫 매개변수의 타입을 string으로 바꿀 수 없다. 고로 에러가 발생한다.
Usecase2의 경우 제약조건 number를 잘 따랐고 B의 타입은 boolean으로 변경하였다.
Usecase3를 보면 전부 number 타입으로 사용하겠다고하며 제약 조건에 성립하여서 가능하다.

기본값으로 지정한 타입과 다른 값은 제공할 수 있지만 제약 조건에 어긋난 타입은 제공할 수 없다.

interface Example {
    a: A,
    b: B,
}

type Usecase1 = Example; // error
type Usecase2 = Example;
type Usecase3 = Example;

솔직히 이런 경우가 존재할지는 모르겠지만 A, B extends A란 생각나는 그대로 
두 타입이 모두 A와 같으면 된다.
Usecase1에서는 두번 째 파라미터 number가 B에 해당하지만 A와 타입이 다르기 때문에 에러가 발생한다.
이것을 쓸 일이 있을까..?

⚔️ 자주 쓰이는 제약조건
 // 모든 객체
 // 모든 배열
 // 모든 함수
 // 생성자 타입
 // string | number | symbol



P.105쪽 부분은 이해가 되지 않아서 같이 확인하면 좋을 것 같다.

2.15 조건문과 비슷한 컨디셔널 타입이 있다.
여기에서도 extends가 사용된다.
여태 상속에서만 쓰다가 아주 여러 곳에서 사용되는 예약어이다.
삼항연산자를 알 것이다.
타입을 변경할때 사용할 수 있는데

특정 타입 extends 다른 타입 ? 참일 때 타입 : 거짓일 때 타입

타입 검사로도 사용할 수 있다.
해당 타입이 맞는지 아닌지를 삼항 연산자를 사용해서 확인이 가능하다.

2.15.1 컨디셔널 타입 분배법칙
string | number 타입으로 string[] 을 얻고 싶은 상황
type Start = string | number;
type Result = Start extends string? Start[] : never;

이 코드의 경우 string | number가 string을 extends 할 수 없기 때문에 never 타입을 반환한다.
type Start = string | number;
type Result = Key extends string ? Key[] : never;
let n: Result = ['hi'];

타입을 제네릭으로 바꾸었다.
검사하려는 타입이 제네릭이면서 유니언이면 분배법칙이 실행된다.
Result는 Result | Result
type Result = Key extends string  ? Key[] : never; 를 거치면 string[] | never가 되고, 
never는 사라져서 최종적으로 string[]이 된다.
(P.110쪽 오타 발견) 
교재에서는 type Result = Key extends string | boolean ? Key[] : never;으로 나와있음
여기의 경우 Start는 string이나 number 타입을 지닌다.
Resulte 제네릭에 Start를 넣으면
Key extends string? 에서 string | number인데 string | number은  string을 지니고 있기 때문에 성립이 된다.
고로 Key[]를 반환하고 해당 Key[]는 string[] 타입을 지닌다.
type Start = string | number | boolean;
type Result = Key extends string | boolean ? Key[] : never;
let n: Result = ['hi'];
n = [true];

Key에 Start가 들어가서
Result는 Result | Result | Result

Start (string | number | boolean) extends string | boolean ? key[] : never;
(string extends string | boolean ? key[] : never) | (number extends string | boolean ? key[] : never) | (boolean extends string | boolean ? key[] : never)
key[] | never | key[]
string[] | never | boolean[]
string[] | boolean[]이 될 것 같지만
string[] | false[] | true[]가 됨
boolean을 true | false로 인식





Start가 string이나 boolean을 포함하고 있으므로 Key[]를 반환할 것이다.
Key[]는 string[] | false[] | true[]를 반환한다.
분배법칙이 일어났으며 boolean이 분배법칙에 적용되었기 때문에 
string, number, boolean에 대하여 string, boolean은 지니고 있어서 반환하고 number는 없어서 false로 반환한 것 같다.
type IsString = T extends string ? true : false;
type Result = IsString; // type Result = boolean

IsString | IsString 이고
(’hi’ extends string ? true : false) | (3 extends string. true : false)
true | false이므로 최종적으로 boolean이 된다.
이럴 때 분배법칙이 일어나지 않게 해야함

배열로 제네릭을 감싸면 분배법칙이 일어나지 않음

type IsString = [T] extends [string] ? true : false;
type Result = IsString; // type Result = false

[’hi’ | 3]이 [string]을 extends하는지 검사하므로 false가 된다.
알아두면 좋은 지식 중 하나는 never도 분배법칙의 대상이 된다.
컨디셔널 타입에서 제네릭과 never가 만나면 무조건 never가 된다고 생각하자.
그렇기 때문에 never을 타입 파라미터로 사용하려면 분배법칙이 일어나는 것을 막아야한다.
분배법칙을 막는 방법? 위에서 적었듯이 배열로 제네릭을 감싸주자. 그러면 막을 수 있다.

week3/week3.html.body:
Week3
2.16, 2.17, 2.18 함수의 타이핑
함수에서는 배열이나 객체처럼 매개변수에 …(나머지) 문법을 사용할 수 있습니다. 배열과 객체와 같은 방법입니다.
function test(a: string, ...arg: string[]) {}
function test1(...arg: number[], b: number) {}

대신 나머지 문법은 매개변수의 가장 마지막에 위치해야 합니다.
이를 이용해서 다음과 같이 이름이 지정되어 있지 않은 튜플을 만들 수도 있습니다.
function tuple(...args: [number, boolean, string]) {}

다만 매개변수를 타이핑 해야할때 조심해야하는 점은 바로 객체에 구조분해 할당을 적용할 때 입니다.
function test({ props: { prop1: string } }) {}
// error

function test2({ props }: { props: { prop1: string } }) {}

첫번째 방법으로 하면 prop1의 타입이 string이 되는것이 아니라 prop1의 별칭이 string으로 설정되는 것입니다. 따라서 두번째 방법으로 구조를 따로 타이핑 해줘야 합니다.
함수의 매개변수를 여러개로 오버로딩하여 사용할 수 있습니다. 실제 구현부에서는 오버로딩한 타입을 전부 합쳐서 명시해 주어야 합니다.
function overloading(name: string): string;
function overloading(name: string | undefined): number;
function overloading(name: string | number | undefined): string | number {
  if (name) {
    return "string";
  } else {
    return 1;
  }
}

const result = overloading("string");

해당 매서드는 1개의 인자에 name이라는 프로퍼티의 타입에 따라 다른 return 타입을 주는것을 알 수 있습니다. 여기서 이 오버로딩을 하는 순서도 중요하는데요 위에서부터 읽기 때문에 같은 string을 입력하더라도 다음과 같은 차이가 발생 합니다.
function overloading(name: string): string;
function overloading(name: string | undefined): number;
function overloading(name: string | number | undefined): string | number {
  if (name) {
    return "string";
  } else {
    return 1;
  }
}

const result = overloading("string");
// return type은 string

function overloading(name: string | undefined): number;
function overloading(name: string): string;
function overloading(name: string | number | undefined): string | number {
  if (name) {
    return "string";
  } else {
    return 1;
  }
}

const result = overloading("string");
// return type은 number;

인터페이스로도 오버로딩 사용을 할 수 있습니다.
interface Add {
  (x: number, y: number): number;
  (x: string, y: string): string;
}

const add: Add = (x: any, y: any) => x + y;



타입 별칭으로도 가능합니다.
type a = (x: number, y: number) => number;
type b = (x: string, y: string) => string;

type Add = a & b;

const add: Add = (x: any, y: any) => x + y;


궁금한 점 - 태림
type Add = {
  (x: number, y: number): number;
  (x: string, y: string): string;
};

const add: Add = (x: any, y: any) => x + y;


이렇게는 못 쓰나
확인 결과 정상적으로 동작도 하는 것 같은데 인터페이스는 다음처럼 써 놓고 왜 타입은 굳이 & 로 예시를 보여 준 것일까?
interface Add {
  (x: number, y: number): number;
  (x: string, y: string): string;
}

const add: Add = (x: any, y: any) => x + y;

→ 인터페이스와 타입에서 많이 사용되는 패턴으로 설명해 준 것 같다는 결론~






함수가 콜백함수로 사용될때 타입스크립트는 자동으로 해당 매개변수를 추론해 줍니다.
이를 통해서 우리가 callback함수의 매개변수를 입력할때 해당 타입을 잘 지정해서 사용할 수 있는 것입니다.
function func(callback: (res: string, req: number) => void) {}


공변성 반공변성
타입은 좁은타입에서 넓은 타입으로만 대입할수 있다고 했습니다. 그러면 함수도 좁은 타입에서 넓은 타입으로 대입할수 있을까요? 그러면 함수는 어떤게 좁은 타입일까요?
함수는 조금 특별하게? 단순히 좁은타입에서 넓은 타입으로 대입할 수 있는게 아니라 공변성과 반공변성을 따져야 합니다.

공변성(Covariance) : A가 B보다 좁은 타입이면, T는 T또한 대입할 수 있다.
반공변성(Contravariance) : A가 B보다 좁은 타입이면, T는 T또한 대입할 수 있다.
이변성(Bivariance) : A가 B보다 좁은 타입이면, T → T도 되고 T → T도 되는 경우
불변성(immutability) :A가 B보다 좁은 타입이더라도, T → T도 안 되고 T → T도 안 되는 경우

리턴값을 살펴 보면 number보다 number| string이 더 넓은 타입이므로 a타입은 B타입에 대입할 수 있습니다. 함수를 대입할때도 마찬가지로 대입할수 있죠 이는 리턴값은 공변성이기 때문입니다.
function a(x: string): number {
  return 0;
}

type B = (x: string) => number | string;

let b: B = a;

그러면 매개변수를 살펴 보겠습니다. B의 매개변수가 a보다 더 넓은 타입이므로 a에서 b를 대입할 수 있습니다. 하지만 에러가 발생하죠
function a(x: string): number {
  return 0;
}

type B = (x: string | number) => number;

let b: B = a;

이를 해결하려면 반대로 작성을 해주어야 하는데요 이는 매개변수가 반공변성이기 때문입니다.
function a(x: string | number): number {
  return 0;
}

type B = (x: string) => number;

let b: B = a;

참고로 tsonfig의 strictFunctionTypes 을 꺼두게 된다면 매개변수는 반공변성이 아니라 이변성이 되어 좁은타입에서 넓은타입으로든 반대든 모두 대입이 가능하게 됩니다.
객체내부의 매서드 작성 방식에 따라 다른데요 함수로 작성할 경우에는 기존과 똑같이 반공변성을 갖지만 매서드로 정의할때는 이변성을 갖습니다.
interface Method {
  say(a: string | number): string;
}

interface Func {
  say: (a: string | number) => string;
}

interface Obj {
  say: {
    (a: string | number): string;
  };
}

const func = (a: string) => "hi";

const methodObj: Method = {
  say: func,
};

const funcObj: Func = {
  say: func,
};
// err

const objObj: Obj = {
  say: func,
};
// err

이변성이라 양방향 다 가능합니다.
interface Method {
  say(a: string): string;
}

const func = (a: string | number) => "hi";

const methodObj: Method = {
  say: func,
};

정리: 리턴값은 공변성을 가지고 매개변수는 반공변성을 가지면서 객체내부의 매서드형과 함수는 이변성을 갖는다.
공변성: 좁은타입에서 넓은 타입 대입가능
반공변성: 넓은 타입에서 좁은 타입 대입가능
이변성: 양방향 다 대입가능

